package com.tsatsatzu.subwar.game.data;import java.util.List;public class SWContextBean{    private SWOperationBean mOperation;    private String  mLastOperationMessage;    private String  mLastOperationError;    private SWUserBean mUser;    private SWGameDetailsBean mGame;    private List<SWUserBean> mLeaders;    public String getLastOperationMessage()    {        return mLastOperationMessage;    }    public void setLastOperationMessage(String lastOperationMessage)    {        mLastOperationMessage = lastOperationMessage;    }    public String getLastOperationError()    {        return mLastOperationError;    }    public void setLastOperationError(String lastOperationError)    {        mLastOperationError = lastOperationError;    }    public SWUserBean getUser()    {        return mUser;    }    public void setUser(SWUserBean user)    {        mUser = user;    }    public SWGameDetailsBean getGame()    {        return mGame;    }    public void setGame(SWGameDetailsBean game)    {        mGame = game;    }    public SWOperationBean getOperation()    {        return mOperation;    }    public void setOperation(SWOperationBean operation)    {        mOperation = operation;    }    public List<SWUserBean> getLeaders()    {        return mLeaders;    }    public void setLeaders(List<SWUserBean> leaders)    {        mLeaders = leaders;    }}